INSERT INTO `faqs` VALUES (1,'What is Arbitex?','Arbitex is a staking platform that generates steady returns through arbitrage-based strategies, without the risks of futures or high-volatility trading.',1,1,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(2,'How does Arbitex work?','You stake your USDT for a fixed duration in one of our tiers, and we use tested arbitrage methods to generate returns. Earnings are credited according to your plan.',1,2,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(3,'Is Arbitex a trading platform?','No. Arbitex is a staking platform that operates on arbitrage principles, not day trading or speculative futures trading.',1,3,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(4,'What makes Arbitex different from other crypto platforms?','We focus on low-risk, market-neutral strategies and do not engage in leveraged or futures trading. Our model is transparent, simple, and designed for steady growth.',1,4,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(5,'Which cryptocurrency does Arbitex support?','Currently, we support USDT and USDC for deposits and withdrawals',1,5,'2025-11-06 21:48:17','2025-11-14 12:15:35'),(6,'Is Arbitex available worldwide?','Yes, Arbitex is available globally, except in jurisdictions where crypto activities are restricted by law.',1,6,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(7,'How does Arbitex generate returns?','We identify price gaps across exchanges and execute arbitrage trades, capturing small, consistent profits over time.',1,7,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(8,'Is Arbitex based on futures trading?','No. Arbitex does not participate in futures or margin trading.',1,8,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(9,'How does Arbitex use arbitrage strategies?','Our system continuously monitors multiple exchanges for price differences and executes trades within seconds to capture those opportunities.',1,9,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(10,'Who can use Arbitex?','Anyone above the legal age in their country of residence who owns USDT (TRC20) can use Arbitex.',1,10,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(11,'How do I create an account?','Visit our website or app, click Sign Up, fill in your details, and verify your email.',1,11,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(12,'Is there a minimum age to register?','Yes, you must be at least 18 years old.',1,12,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(13,'Do I need KYC verification?','Yes, KYC is required for Tier 2 and higher. Tier 1 does not require KYC.',1,13,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(14,'Can I open multiple accounts?','No, each person is allowed only one account.',1,14,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(15,'How do I log in to my account?','Go to the login page, enter your email and password, and complete the authentication process.',1,15,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(16,'I forgot my password ‚Äî what should I do?','Click Forgot Password on the login page and follow the reset instructions sent to your email.',1,16,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(17,'How do I update my account details?','You can update personal details from your account dashboard settings.',1,17,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(18,'Is my account information secure?','Yes, we use encryption and multi-layered security protocols to protect user data.',1,18,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(19,'Can I change my registered email address?','Yes, by submitting a request to our support team for verification.',1,19,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(20,'How do I delete my account?','You can request account deletion via customer support after clearing all balances.',1,20,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(21,'What currencies can I deposit?','We currently accept USDT and USDC.',1,21,'2025-11-06 21:48:17','2025-11-14 12:27:09'),(22,'What is the minimum deposit amount?','The minimum deposit is based on your chosen staking tier, starting from Tier 1.',1,22,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(23,'Does Arbitex support multiple networks?','Yes, we support BEP20, ERC20, and TRC20.',1,23,'2025-11-06 21:48:17','2025-11-14 12:27:46'),(24,'How do I deposit funds into my account?','Login, go to deposit, choose currency, choose network, copy your wallet and transfer your funds.',1,24,'2025-11-06 21:48:17','2025-11-14 12:28:21'),(25,'How long does it take for a deposit to reflect?','Deposits typically reflect within minutes, depending on network speed.',1,25,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(26,'Are there any deposit fees?','Arbitex does not charge deposit fees.',1,26,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(27,'What happens if I send funds to the wrong address?','Unfortunately, crypto transactions are irreversible, so please double-check before sending.',1,27,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(28,'Can I deposit from any crypto wallet?','Yes',1,28,'2025-11-06 21:48:17','2025-11-14 12:28:49'),(29,'Is my deposit safe?','Yes, all deposits are stored securely in cold wallets only.',1,29,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(30,'What is staking in Arbitex?','It\'s the process of locking your USDT for a fixed period to earn returns through our arbitrage strategies.',1,30,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(31,'How do I start staking?','After depositing USDT, select your tier and duration from the staking section and confirm your stake.',1,31,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(32,'What staking tiers are available?','We offer 7 tiers, starting from Tier 1 (0‚Äì500 USDT) up to Tier 7 (50,000+ USDT).',1,32,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(33,'What are the staking durations?','You can choose from 10, 30, 60, 90, and 180-day plans.',1,33,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(34,'Can I stake more than one plan at the same time?','Yes, you can stake multiple plans simultaneously.',1,34,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(35,'How are returns calculated?','Returns are based on your tier and duration, with rates fixed at the time of staking.',1,35,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(36,'When will I receive my earnings?','Earnings are credited at the end of the staking period.',1,36,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(37,'Can I withdraw my stake before maturity?','No, early withdrawals are not available to maintain strategy stability.',1,37,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(38,'What happens when my staking plan ends?','Your stake and earnings are released to your wallet balance, ready for withdrawal or reinvestment.',1,38,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(39,'Is there a maximum staking limit?','No, but each tier has a defined deposit range.',1,39,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(40,'How do I withdraw my funds?','Go to Withdraw, enter the amount, paste your TRC20 wallet address, and confirm.',1,40,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(41,'What is the minimum withdrawal amount?','The minimum withdrawal amount is 50 USDT.',1,41,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(42,'Are there withdrawal fees?','Yes, withdrawals have a fixed $2 fee.',1,42,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(43,'How long do withdrawals take?','Withdrawals are typically processed within minutes, subject to network confirmation.',1,43,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(44,'Which network is used for withdrawals?','BEP20, ERC20, and TRC20',1,44,'2025-11-06 21:48:17','2025-11-14 12:29:13'),(45,'Can I withdraw to any wallet address?','Yes',1,45,'2025-11-06 21:48:17','2025-11-14 12:35:40'),(46,'Are withdrawals processed 24/7?','Yes, withdrawal requests are processed around the clock.',1,46,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(47,'What should I do if my withdrawal is delayed?','Contact our support team with your transaction ID for assistance.',1,47,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(48,'Is there a daily withdrawal limit?','No fixed daily limit, but very large withdrawals may require additional verification.',1,48,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(49,'Can I cancel a withdrawal request?','Yes, withdrawal requests can be cancelled before processing.',1,49,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(50,'Is Arbitex regulated?','We operate in compliance with applicable laws in jurisdictions where we offer services.',1,50,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(51,'How does Arbitex protect my funds?','Funds are secured using multi-layer wallet systems, cold storage, and advanced cybersecurity measures.',1,51,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(52,'Are my transactions encrypted?','Yes, all transactions and data transfers are encrypted using industry-standard protocols.',1,52,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(53,'How do I enable two-factor authentication (2FA)?','2FA is enabled through email code verification.',1,53,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(54,'What should I do if I suspect suspicious activity?','Immediately change your password, enable 2FA, and contact support.',1,54,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(55,'Has Arbitex ever been hacked?','No, Arbitex has maintained a strong security record with no breaches.',1,55,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(56,'How does Arbitex ensure transparency?','We provide clear staking terms, fixed rates, and accurate reporting in your dashboard.',1,56,'2025-11-06 21:48:17','2025-11-06 21:48:17'),(57,'How do I contact Arbitex support?','You can reach our support team through the Help Center, live chat, or email support@arbitex.io.',1,57,'2025-11-06 21:48:17','2025-11-06 21:48:17');
