INSERT INTO `page_seo` VALUES (1,'home','Home','Arbitex ‚Äî Secure Crypto Investments | Earn Passively, Trade Confidently','Welcome to Arbitex ‚Äî a reliable crypto investment platform where your USDT grows securely through staking. No trading stress, no hidden risks ‚Äî just smart passive income with full transparency.','Arbitex, crypto investments, passive income, secure staking, invest in crypto, USDT staking, reliable crypto platform, DeFi profits','2025-11-09 07:08:21','2025-11-09 07:08:21'),(2,'about','About Us','About Arbitex ‚Äî Trusted Crypto Platform for Smart Investors','Learn more about Arbitex and our mission to make crypto investing simple and secure. We combine technology, transparency, and experience to deliver real results and peace of mind.','about Arbitex, Arbitex team, secure crypto platform, blockchain investments, trusted DeFi, transparent crypto projects, smart investing','2025-11-09 07:08:21','2025-11-09 07:08:21'),(3,'tiers','Profit Tiers','Arbitex Profit Tiers ‚Äî Investment Plans & Earnings Levels','Choose your profit tier with Arbitex. Flexible staking plans offering up to 15% monthly returns. Start earning with crypto safely, transparently, and automatically.','Arbitex profit tiers, crypto income plans, staking returns, crypto investment packages, USDT staking, monthly profit, passive crypto earnings','2025-11-09 07:08:21','2025-11-09 07:08:21'),(4,'blog','Blog','Arbitex Blog ‚Äî Crypto Insights, Strategies & Financial Freedom','Explore the Arbitex blog for expert insights on crypto investing, DeFi trends, and passive income strategies. Learn how to grow your capital safely and confidently.','Arbitex blog, crypto news, crypto investment tips, DeFi strategies, passive income, blockchain insights, cryptocurrency education','2025-11-09 07:08:21','2025-11-09 07:08:21'),(5,'contact','Contact Us','Contact Arbitex ‚Äî Support, Partnership & Investment Assistance','Need help or want to partner with us? The Arbitex team is here for you 24/7. Get in touch and start your journey toward safe, profitable crypto investing today.','contact Arbitex, Arbitex support, partnership, crypto investing help, get in touch, customer service, crypto business cooperation','2025-11-09 07:08:21','2025-11-09 07:08:21'),(6,'faq','FAQ','Arbitex FAQ ‚Äî Answers to Common Crypto Investment Questions','Find quick answers about Arbitex, staking, profit tiers, and investment safety. Everything you need to know before starting your crypto journey with full confidence.','Arbitex FAQ, crypto questions, staking explained, safe crypto investments, how to invest in crypto, DeFi income, passive crypto returns','2025-11-09 07:08:21','2025-11-09 07:08:21'),(7,'login','Login','Login to Arbitex ‚Äî Access Your Crypto Investment Dashboard','Sign in to your Arbitex account and manage your crypto investments easily. Track your profits, view staking progress, and stay in control of your digital assets ‚Äî securely and instantly.','Arbitex login, crypto dashboard, account access, crypto investment login, staking account, secure login, user dashboard, passive income tracking','2025-11-09 07:08:21','2025-11-09 07:08:21'),(8,'register','Register','Join Arbitex ‚Äî Start Earning with Secure Crypto Investments','Create your free Arbitex account today and begin earning passive income with crypto. Safe, transparent, and user-friendly ‚Äî your gateway to smart digital wealth.','Arbitex register, create account, join Arbitex, crypto registration, start staking, invest in crypto, passive income platform, secure crypto earnings','2025-11-09 07:08:21','2025-11-09 07:08:21');
