DROP TABLE IF EXISTS `users`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `uuid` char(36) DEFAULT NULL,
  `google_id` varchar(255) DEFAULT NULL,
  `name` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `new_email` varchar(255) DEFAULT NULL,
  `email_change_code` varchar(6) DEFAULT NULL,
  `email_change_code_expires_at` timestamp NULL DEFAULT NULL,
  `email_verification_code` varchar(6) DEFAULT NULL,
  `email_verification_code_expires_at` timestamp NULL DEFAULT NULL,
  `login_2fa_code` varchar(6) DEFAULT NULL,
  `login_2fa_code_expires_at` timestamp NULL DEFAULT NULL,
  `login_2fa_verified` tinyint(1) NOT NULL DEFAULT 0,
  `login_2fa_last_verified_at` timestamp NULL DEFAULT NULL,
  `password_reset_code` varchar(6) DEFAULT NULL,
  `password_reset_code_expires_at` timestamp NULL DEFAULT NULL,
  `avatar` varchar(255) DEFAULT NULL,
  `email_verified_at` timestamp NULL DEFAULT NULL,
  `password` varchar(255) NOT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `country_code` varchar(5) DEFAULT NULL,
  `country` varchar(2) DEFAULT NULL,
  `gender` enum('male','female','other') DEFAULT NULL,
  `is_admin` tinyint(1) NOT NULL DEFAULT 0,
  `balance` decimal(18,2) NOT NULL DEFAULT 0.00,
  `deposited` decimal(18,2) NOT NULL DEFAULT 0.00,
  `current_tier` int(10) unsigned DEFAULT NULL,
  `referral_code` varchar(32) DEFAULT NULL,
  `referred_by` bigint(20) unsigned DEFAULT NULL,
  `active` tinyint(1) NOT NULL DEFAULT 1,
  `referral_level_id` bigint(20) unsigned DEFAULT NULL,
  `blocked` tinyint(1) NOT NULL DEFAULT 0,
  `withdrawal_blocked` tinyint(1) NOT NULL DEFAULT 0,
  `failed_login_attempts` int(10) unsigned NOT NULL DEFAULT 0,
  `account_locked_at` timestamp NULL DEFAULT NULL,
  `verification_status` enum('unverified','pending','verified') NOT NULL DEFAULT 'unverified',
  `verification_document_path` varchar(255) DEFAULT NULL,
  `remember_token` varchar(100) DEFAULT NULL,
  `account_type` enum('normal','islamic') DEFAULT 'normal',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_email_unique` (`email`),
  UNIQUE KEY `users_uuid_unique` (`uuid`),
  UNIQUE KEY `users_google_id_unique` (`google_id`),
  UNIQUE KEY `users_referral_code_unique` (`referral_code`),
  KEY `users_referred_by_foreign` (`referred_by`),
  KEY `users_referral_level_id_foreign` (`referral_level_id`),
  KEY `users_current_tier_index` (`current_tier`),
  KEY `users_blocked_index` (`blocked`),
  CONSTRAINT `users_referral_level_id_foreign` FOREIGN KEY (`referral_level_id`) REFERENCES `referral_levels` (`id`) ON DELETE SET NULL,
  CONSTRAINT `users_referred_by_foreign` FOREIGN KEY (`referred_by`) REFERENCES `users` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=164 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
